<?php

namespace Appleton\Taxes\Seeds\US\Alabama;

use Appleton\Taxes\Countries\US\Alabama\GoodwaterOccupational;
use DB;
use Illuminate\Database\Seeder;

class GoodwaterSeeder extends Seeder
{
    public function run()
    {
        if (DB::table(config('taxes.governmental_unit_areas'))->where('name', 'Goodwater, AL')->exists()) return;

        $id = DB::table(config('taxes.governmental_unit_areas'))->insertGetId([
            'name' => 'Goodwater, AL',
            'area' => '',
        ]);

        DB::table(config('taxes.tax_areas'))->insert([
            'name' => 'Goodwater Occupational Tax',
            'tax' => GoodwaterOccupational::class,
            'governmental_unit_area_id' => $id,
        ]);
    }
}
